import React, { useEffect } from 'react';

const App = () => {

  useEffect(() => {
    fetch('/api/customers/all')
    .then(response => {
      response.text()
      .then(data => {
        console.log(JSON.parse(data));
      })
    })
    .catch(error => {
      console.error(error);
    });
  }, [])

  return (
    <div>
      this is my app
    </div>
  );
}

export default App;
